    [],nt"revision_timestamp": "2016-07-27T22:41:45.319840",nt"name": "baseline-study-of-trace-elements-and-organic-compounds-at-national-wildlife-refuges-a-1987",nt"isopen":
    false,nt"url": null,nt"notes": "Analytical data for all 3 years is presented
    in Appendix A (selected trace elements), Appendix B (ICP scan), Appendix C (organochlorines
    and PCB's), Appendix D (aliphatic hydrocarbons) and Appendix E (aromatic hydrocarbons).
    Geometric means and ranges of arsenic, mercury, selenium, and molybdenum concentrations
    found in sediment, fish, and bird livers are summarized in Table 2. Geometric means
    of other trace element concentrations (ICP scan) found within these matrices are
    summarized in Table 3. Preliminary interpretation of data indicates that most tissue
    and sediment samples collected in this study contained concentrations of selenium
    and mercury considered representative of naturally occurring background levels.
    However, one gadwall liver tissue contained elevated levels of selenium (25.0 ppm
    dry weight). Arsenic concentrations were generally below detectable limits in tissue
    samples. Arsenic ranged from 1.77-6.3 ppm dry weight in sediment samples and is
    representative of an unpolluted aquatic environment. Concentrations of organochlorines,
    PCB's and hydrocarbons were at very low levels or below detectable levels. The analytical
    data has not undergone thorough expert review and therefore may warrant further
    interpretation before meaningful conclusions can be finalized. Consequently, the
    report should be considered preliminary in nature and subject to revision upon completion
    of a comprehensive literature review and data interpretation. If appropriate, discussions
    and conclusions will be presented at that time.",nt"license_title": "License
